(1, 'Đâu là giá trị mặc định của thuộc tính overflow?', 'visible', 'auto', 'scroll', 'visible'),
(2, 'Giá trị nào của box-shadow giúp tạo bóng đổ sang trái 20px, xuống dưới 20px và có màu đen?', '20px 20px black', '20px -20px black', '-20px 20px black', '-20px 20px black'),
(3, 'Vòng lặp while trong JavaScript thích hợp khi nào?', 'khi muốn thực thi khối lệnh ít nhất 1 lần', 'Khi số lần lập lại xác định trước', 'Khi số lần lặp lại không xác định trước', 'Khi số lần lặp lại không xác định trước'),
(4, 'Trong JavaScript, kết quả của biểu thức false || 0 || \"\" || \"Hello\" là gì?', 'true', '\"Hello\"', 'false', '\"Hello\"'),
(5, 'Trong JavaScript, toán tử && và || trả về kiểu dữ liệu nào?', 'Luôn là Number', 'Tuỳ vào dữ liệu của toán hạng', 'Luôn là Boolean', 'Tuỳ vào dữ liệu của toán hạng'),
(6, 'Trong JavaScript, phép so sánh 1 == true sẽ trả về?', 'true vì 1 được chuyển thành true', 'NaN', 'true vì true được chuyển thành 1', 'true vì true được chuyển thành 1'),
(7, 'Cổng (port) mặc định cho HTTP?', '443', '8000', '80', '80'),
(8, 'Cách khai báo biến có phạm vi toàn cục (Global Scope) trong JavaScript là gì?', 'Khai báo ngoài mọi hàm,block module', 'Khai báo trong 1 block if', 'Khai báo ngoài cùng 1 module', 'Khai báo ngoài mọi hàm,block module'),
(9, 'Ví dụ, mình có file index.html và bên trong sử dụng hình ảnh với đường dẫn ./monkey.jpg. Hỏi: 2 files này có quan hệ với nhau như thế nào?', 'Nằm ở hai thư mục khác nhau', 'Đứng cạnh nhau', 'Cấp cha con', 'Đứng cạnh nhau'),
(10, 'Chrome DevTools là công cụ dành cho ai?', 'Nhà phát hành trang web', 'Người dùng thông dụng', 'Người am hiểu máy tính', 'Nhà phát hành trang web');
