('Loading', 54, '<!-- index.html -->\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <title>Loading Animations</title>\n    <link rel=\"stylesheet\" href=\"styles.css\">\n</head>\n<body>\n    <div class=\"loader loader1\"></div>\n    <div class=\"loader loader2\"></div>\n    <div class=\"loader loader3\"></div>\n</body>\n</html>', '/* styles.css */\nbody {\n    display: flex;\n    justify-content: space-around;\n    align-items: center;\n    height: 100vh;\n    margin: 0;\n    background-color: #f0f0f0;\n}\n\n.loader {\n    width: 60px;\n    height: 60px;\n}\n\n/* Animation 1: Spinning Loader */\n.loader1 {\n    border: 8px solid #f3f3f3; /* Light grey */\n    border-top: 8px solid #3498db; /* Blue */\n    border-radius: 50%;\n    animation: spin 1s linear infinite;\n}\n\n/* Animation 2: Bouncing Loader */\n.loader2 {\n    background-color: #3498db;\n    border-radius: 50%;\n    animation: bounce 0.6s infinite alternate;\n}\n\n/* Animation 3: Pulsing Loader */\n.loader3 {\n    background-color: #e74c3c;\n    border-radius: 50%;\n    animation: pulse 1s infinite;\n}\n\n@keyframes spin {\n    0% { transform: rotate(0deg); }\n    100% { transform: rotate(360deg); }\n}\n\n@keyframes bounce {\n    0% { transform: translateY(0); }\n    100% { transform: translateY(-30px); }\n}\n\n@keyframes pulse {\n    0% { transform: scale(1); }\n    100% { transform: scale(1.5); }\n}', '', '\n      <!DOCTYPE html>\n      <html>\n        <head>\n          <style>body{color: white}/* styles.css */\nbody {\n    display: flex;\n    justify-content: space-around;\n    align-items: center;\n    height: 100vh;\n    margin: 0;\n    background-color: #f0f0f0;\n}\n\n.loader {\n    width: 60px;\n    height: 60px;\n}\n\n/* Animation 1: Spinning Loader */\n.loader1 {\n    border: 8px solid #f3f3f3; /* Light grey */\n    border-top: 8px solid #3498db; /* Blue */\n    border-radius: 50%;\n    animation: spin 1s linear infinite;\n}\n\n/* Animation 2: Bouncing Loader */\n.loader2 {\n    background-color: #3498db;\n    border-radius: 50%;\n    animation: bounce 0.6s infinite alternate;\n}\n\n/* Animation 3: Pulsing Loader */\n.loader3 {\n    background-color: #e74c3c;\n    border-radius: 50%;\n    animation: pulse 1s infinite;\n}\n\n@keyframes spin {\n    0% { transform: rotate(0deg); }\n    100% { transform: rotate(360deg); }\n}\n\n@keyframes bounce {\n    0% { transform: translateY(0); }\n    100% { transform: translateY(-30px); }\n}\n\n@keyframes pulse {\n    0% { transform: scale(1); }\n    100% { transform: scale(1.5); }\n}</style>\n        </head>\n        <body>\n          <!-- index.html -->\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <title>Loading Animations</title>\n    <link rel=\"stylesheet\" href=\"styles.css\">\n</head>\n<body>\n    <div class=\"loader loader1\"></div>\n    <div class=\"loader loader2\"></div>\n    <div class=\"loader loader3\"></div>\n</body>\n</html>\n          <script>\n            try {\n              \n            } catch(err) {\n              console.error(err);\n            }\n          </script>\n        </body>\n      </html>\n    ', 'example@gmail.com', '2024-12-16 10:11:19', '2024-12-16 10:11:19', 0, 'public'),
('Loading 2', 55, '<!-- index.html -->\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <title>Beautiful Loading Animations</title>\n    <link rel=\"stylesheet\" href=\"styles.css\">\n</head>\n<body>\n    <div class=\"loader loader1\"></div>\n    <div class=\"loader loader2\"></div>\n    <div class=\"loader loader3\"></div>\n</body>\n</html>', '/* styles.css */\nbody {\n    display: flex;\n    justify-content: space-around;\n    align-items: center;\n    height: 100vh;\n    margin: 0;\n    background-color: #f0f0f0;\n}\n\n.loader {\n    width: 60px;\n    height: 60px;\n}\n\n/* Animation 1: Rotating Squares */\n.loader1 {\n    position: relative;\n    animation: rotate 1.5s linear infinite;\n}\n\n.loader1::before, .loader1::after {\n    content: \'\';\n    position: absolute;\n    width: 100%;\n    height: 100%;\n    background-color: #3498db;\n    animation: scale 1.5s linear infinite;\n}\n\n.loader1::before {\n    animation-delay: 0.75s;\n}\n\n/* Animation 2: Fading Dots */\n.loader2 {\n    display: flex;\n    justify-content: space-between;\n    align-items: center;\n}\n\n.loader2 div {\n    width: 15px;\n    height: 15px;\n    background-color: #e74c3c;\n    border-radius: 50%;\n    animation: fade 0.6s infinite alternate;\n}\n\n.loader2 div:nth-child(2) {\n    animation-delay: 0.2s;\n}\n\n.loader2 div:nth-child(3) {\n    animation-delay: 0.4s;\n}\n\n/* Animation 3: Circular Loader */\n.loader3 {\n    border: 8px solid transparent;\n    border-top: 8px solid #9b59b6; /* Purple */\n    border-radius: 50%;\n    animation: spin 1s linear infinite;\n}\n\n@keyframes rotate {\n    0% { transform: rotate(0deg); }\n    100% { transform: rotate(360deg); }\n}\n\n@keyframes scale {\n    0% { transform: scale(1); }\n    100% { transform: scale(0.5); }\n}\n\n@keyframes fade {\n    0% { opacity: 1; }\n    100% { opacity: 0.2; }\n}\n\n@keyframes spin {\n    0% { transf