('Moving', 56, '<!-- index.html -->\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <title>Beautiful Animations</title>\n    <link rel=\"stylesheet\" href=\"styles.css\">\n</head>\n<body>\n    <div class=\"animation-container\">\n        <div class=\"bounce\"></div>\n        <div class=\"shake\"></div>\n        <div class=\"fade-in\"></div>\n    </div>\n</body>\n</html>', '/* styles.css */\nbody {\n    display: flex;\n    justify-content: center;\n    align-items: center;\n    height: 100vh;\n    margin: 0;\n    background-color: #f0f0f0;\n}\n\n.animation-container {\n    display: flex;\n    flex-direction: column;\n    gap: 20px;\n}\n\n/* Animation 1: Bouncing Ball */\n.bounce {\n    width: 60px;\n    height: 60px;\n    background-color: #3498db;\n    border-radius: 50%;\n    animation: bounce 1s infinite;\n}\n\n/* Animation 2: Shaking Box */\n.shake {\n    width: 60px;\n    height: 60px;\n    background-color: #e74c3c;\n    animation: shake 0.5s infinite;\n}\n\n/* Animation 3: Fade-In Box */\n.fade-in {\n    width: 60px;\n    height: 60px;\n    background-color: #9b59b6;\n    opacity: 0;\n    animation: fadeIn 2s forwards;\n    animation-delay: 1s; /* Delay before the fade-in starts */\n}\n\n@keyframes bounce {\n    0%, 20%, 50%, 80%, 100% { transform: translateY(0); }\n    40% { transform: translateY(-30px); }\n    60% { transform: translateY(-15px); }\n}\n\n@keyframes shake {\n    0%, 100% { transform: translateX(0); }\n    25% { transform: translateX(-10px); }\n    50% { transform: translateX(10px); }\n    75% { transform: translateX(-10px); }\n}\n\n@keyframes fadeIn {\n    0% { opacity: 0; }\n    100% { opacity: 1; }\n}', '', '\n      <!DOCTYPE html>\n      <html>\n        <head>\n          <style>body{color: white}/* styles.css */\nbody {\n    display: flex;\n    justify-content: center;\n    align-items: center;\n    height: 100vh;\n    margin: 0;\