('Tetris', 57, '<!-- index.html -->\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <title>Tetris Animation</title>\n    <link rel=\"stylesheet\" href=\"styles.css\">\n</head>\n<body>\n    <div class=\"tetris-container\">\n        <div class=\"block block1\"></div>\n        <div class=\"block block2\"></div>\n        <div class=\"block block3\"></div>\n        <div class=\"block block4\"></div>\n    </div>\n</body>\n</html>', '/* styles.css */\nbody {\n    display: flex;\n    justify-content: center;\n    align-items: center;\n    height: 100vh;\n    margin: 0;\n    background-color: #222;\n}\n\n.tetris-container {\n    position: relative;\n    width: 200px;\n    height: 400px;\n    overflow: hidden;\n    border: 2px solid #fff;\n    background-color: #000;\n}\n\n.block {\n    position: absolute;\n    width: 40px;\n    height: 40px;\n    opacity: 0.8;\n}\n\n.block1 {\n    background-color: #3498db; /* Blue */\n    animation: fall 2s linear infinite;\n}\n\n.block2 {\n    background-color: #e74c3c; /* Red */\n    animation: fall 2s linear infinite 0.5s;\n}\n\n.block3 {\n    background-color: #f1c40f; /* Yellow */\n    animation: fall 2s linear infinite 1s;\n}\n\n.block4 {\n    background-color: #9b59b6; /* Purple */\n    animation: fall 2s linear infinite 1.5s;\n}\n\n@keyframes fall {\n    0% {\n        top: -40px; /* Start above the container */\n    }\n    100% {\n        top: 400px; /* End at the bottom of the container */\n    }\n}', '', '\n      <!DOCTYPE html>\n      <html>\n        <head>\n          <style>body{color: white}/* styles.css */\nbody {\n    display: flex;\n    justify-content: center;\n    align-items: center;\n    height: 100vh;\n    margin: 0;\n    background-color: #222;\n}\n\n.tetris-container {\n    position: relative;\n    width: 200px;\n    height: 400px;\n    overflow: hidden;\n    border: 2px solid #fff;\n    background-color: #000;\n}\n\n.block {\n    position: absolute;\n    width: 40px;\n    height: 40px;\n    opacity: 0.8;\n}\n\n.block1 {\n    background-color: #3498db; /* Blue */\n    animation: fall 2s linear infinite;\n}\n\n.block2 {\n    background-color: #e74c3c; /* Red */\n    animation: fall 2s linear infinite 0.5s;\n}\n\n.block3 {\n    background-color: #f1c40f; /* Yellow */\n    animation: fall 2s linear infinite 1s;\n}\n\n.block4 {\n    background-color: #9b59b6; /* Purple */\n    animation: fall 2s linear infinite 1.5s;\n}\n\n@keyframes fall {\n    0% {\n        top: -40px; /* Start above the container */\n    }\n    100% {\n        top: 400px; /* End at the bottom of the container */\n    }\n}</style>\n        </head>\n        <body>\n          <!-- index.html -->\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <title>Tetris Animation</title>\n    <link rel=\"stylesheet\" href=\"styles.css\">\n</head>\n<body>\n    <div class=\"tetris-container\">\n        <div class=\"block block1\"></div>\n        <div class=\"block block2\"></div>\n        <div class=\"block block3\"></div>\n        <div class=\"block block4\"></div>\n    </div>\n</body>\n</html>\n          <script>\n            try {\n              \n            } catch(err) {\n              console.error(err);\n            }\n          </script>\n        </body>\n      </html>\n    ', 'example@gmail.com', '2024-12-16 10:20:55', '2024-12-16 10:20:55', 0, 'public'),
('Card game', 58, '<!-- index.html -->\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <title>Memory Game</title>\n    <link rel=\"stylesheet\" href=\"styles.css\">\n</head>\n<body>\n    <div class=\"memory-game\">\n        <div class=\"card\" id=\"card1\"></div>\n        <div class=\"card\" id=\"card2\"></div>\n        <div class=\"card\" id=\"card3\"></div>\n        <div class=\"card\" id=\"card4\"></div>\n        <div class=\"card\" id=\"card5\"></div>\n        <div class=\"card\" id=\"card6\"></div>\n    </div>\n</body>\n</html>', '/* styles.css */\nbody {\n    display: flex;\n    justify-content: center;\n    align-items: center;\n    height: 100vh;\n    margin: 0;\n    background-color: #f0f0f0;\n}\n\n.memory-game {\n    display: grid;\n    grid-template-columns: repeat(3, 100px);\n    gap: 10px;\n}\n\n.card {\n    width: 100px;\n    height: 100px;\n    background-color: #3498db;\n    position: relative;\n    cursor: pointer;\n    transition: transform 0.5s;\n}\n\n.card:before {\n    content: \'\';\n    position: absolute;\n    width: 100%;\n    height: 100%;\n    background-color: #2980b9;\n    backface-visibility: hidden;\n    transition: transform 0.5s;\n}\n\n.card:after {\n    content: \'!\';\n    position: absolute;\n    width: 100%;\n    height: 100%;\n    display: flex;\n    justify-content: center;\n    align-items: center;\n    font-size: 2em;\n    color: white;\n    backface-visibility: hidden;\n    transform: rotateY(180deg);\n}\n\n.card:hover {\n    transform: rotateY(180deg);\n}', '', '\n      <!DOCTYPE html>\n      <html>\n        <head>\n          <style>body{color: white}/* styles.css */\nbody {\n    display: flex;\n    justify-content: center;\n    align-items: center;\n    height: 100vh;\n    margin: 0;\n    background-color: #f0f0f0;\n}\n\n.memory-game {\n    display: grid;\n    grid-template-columns: repeat(3, 100px);\n    gap: 10px;\n}\n\n.card {\n    width: 100px;\n    height: 100px;\n    background-color: #3498db;\n    position: relative;\n    cursor: pointer;\n    transition: transform 0.5s;\n}\n\n.card:before {\n    content: \'\';\n    position: absolute;\n    width: 100%;\n    height: 100%;\n    background-color: #2980b9;\n    backface-visibility: hidden;\n    transition: transform 0.5s;\n}\n\n.card:after {\n    content: \'!\';\n    position: absolute;\n    width: 100%;\n    height: 100%;\n    display: flex;\n    justify-content: center;\n    align-items: center;\n    font-size: 2em;\n    color: white;\n    backface-visibility: hidden;\n    transform: rotateY(180deg);\n}\n\n.card:hover {\n    transform: rotateY(180deg);\n}</style>\n        </head>\n        <body>\n          <!-- index.html -->\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <title>Memory Game</title>\n    <link rel=\"stylesheet\" href=\"styles.css\">\n</head>\n<body>\n    <div class=\"memory-game\">\n        <div class=\"card\" id=\"card1\"></div>\n        <div class=\"card\" id=\"card2\"></div>\n        <div class=\"card\" id=\"card3\"></div>\n        <div class=\"card\" id=\"card4\"></div>\n        <div class=\"card\" id=\"card5\"></div>\n        <div class=\"card\" id=\"card6\"></div>\n    </div>\n</body>\n</html>\n          <script>\n            try {\n              \n            } catch(err) {\n              console.error(err);\n            }\n          </script>\n        </body>\n      </html>\n    ', 'example@gmail.com', '2024-12-16 10:25:44', '2024-12-16 10:25:44', 0, 'public'),
('Pong game', 59, '\n  <canvas id=\"pongCanvas\" width=\"800\" height=\"400\"></canvas>\n', '/* styles.css */\nbody {\n    display: flex;\n    justify-content: center;\n    align-items: center;\n    height: 100vh;\n    margin: 0;\n    background-color: #222;\n}\n\ncanvas {\n    border: 2px solid #fff;\n}', '// script.js\nconst canvas = document.getElementById(\'pongCanvas\');\nconst ctx = canvas.getContext(\'2d\');\n\nlet paddleWidth = 10, paddleHeight = 100;\nlet player1Y = 150, player2Y = 150;\nlet ballX = canvas.width / 2, ballY = canvas.height / 2;\nlet ballSpeedX = 5, ballSpeedY = 5;\n\nfunction draw() {\n    ctx.clearRect(0, 0, canvas.width, canvas.height);\n    \n    // Draw paddles\n    ctx.fillStyle = \'white\';\n    ctx.fillRect(0, player1Y, paddleWidth, paddleHeight);\n    ctx.fillRect(canvas.width - paddleWidth, player2Y, paddleWidth, paddleHeight);\n    \n    // Draw ball\n    ctx.beginPath();\n    ctx.arc(ballX, ballY, 10, 0, Math.PI * 2);\n    ctx.fill();\n}\n\nfunction update() {\n    ballX += ballSpeedX;\n    ballY += ballSpeedY;\n\n    // Ball collision with top and bottom\n    if (ballY <= 0 || ballY >= canvas.height) {\n        ballSpeedY = -ballSpeedY;\n    }\n\n    // Ball collision with paddles\n    if (ballX <= paddleWidth && ballY > player1Y && ballY < player1Y + paddleHeight) {\n        ballSpeedX = -ballSpeedX;\n    }\n    if (ballX >= canvas.width - paddleWidth && ballY > player2Y && ballY < player2Y + paddleHeight) {\n        ballSpeedX = -ballSpeedX;\n    }\n\n    // Reset ball if it goes out of bounds\n    if (ballX < 0 || ballX > canvas.width) {\n        ballX = canvas.width / 2;\n        ballY = canvas.height / 2;\n    }\n}\n\nfunction movePaddle(event) {\n    const key = event.key;\n    if (key === \'w\' && player1Y > 0) {\n        player1Y -= 20;\n    } else if (key === \'s\' && player1Y < canvas.height - paddleHeight) {\n        player1Y += 20;\n    }\n    if (key === \'ArrowUp\' && player2Y > 0) {\n        player2Y -= 20;\n    } else if (key === \'ArrowDown\' && player2Y < canvas.height - paddleHeight) {\n        player2Y += 20;\n    }\n}\n\ndocument.addEventListener(\'keydown\', movePaddle);\n\nfunction gameLoop() {\n    draw();\n    update();\n    requestAnimationFrame(gameLoop);\n}\n\ngameLoop();', '\n      <!DOCTYPE html>\n      <html>\n        <head>\n          <meta charset=\"UTF-8\">\n          <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n          <style>\n            body {\n              color: white;\n              background-color: #000; /* Optional: Set a background color */\n            }\n            /* styles.css */\nbody {\n    display: flex;\n    justify-content: center;\n    align-items: center;\n    height: 100vh;\n    margin: 0;\n    background-color: #222;\n}\n\ncanvas {\n    border: 2px solid #fff;\n}\n          </style>\n        </head>\n        <body>\n          \n  <canvas id=\"pongCanvas\" width=\"800\" height=\"400\"></canvas>\n\n          <script>\n            // Ensure the script runs after the DOM is fully loaded\n            document.addEventListener(\'DOMContentLoaded\', () => {\n              try {\n               \n                // Your drawing logic here...\n                // Example: ctx.fillStyle = \'red\'; ctx.fillRect(10, 10, 50, 50);\n                // script.js\nconst canvas = document.getElementById(\'pongCanvas\');\nconst ctx = canvas.getContext(\'2d\');\n\nlet paddleWidth = 10, paddleHeight = 100;\nlet player1Y = 150, player2Y = 150;\nlet ballX = canvas.width / 2, ballY = canvas.height / 2;\nlet ballSpeedX = 5, ballSpeedY = 5;\n\nfunction draw() {\n    ctx.clearRect(0, 0, canvas.width, canvas.height);\n    \n    // Draw paddles\n    ctx.fillStyle = \'white\';\n    ctx.fillRect(0, player1Y, paddleWidth, paddleHeight);\n    ctx.fillRect(canvas.width - paddleWidth, player2Y, paddleWidth, paddleHeight);\n    \n    // Draw ball\n    ctx.beginPath();\n    ctx.arc(ballX, ballY, 10, 0, Math.PI * 2);\n    ctx.fill();\n}\n\nfunction update() {\n    ballX += ballSpeedX;\n    ballY += ballSpeedY;\n\n    // Ball collision with top and bottom\n    if (ballY <= 0 || ballY >= canvas.height) {\n        ballSpeedY = -ballSpeedY;\n    }\n\n    // Ball collision with paddles\n    if (ballX <= paddleWidth && ballY > player1Y && ballY < player1Y + paddleHeight) {\n        ballSpeedX = -ballSpeedX;\n    }\n    if (ballX >= canvas.width - paddleWidth && ballY > player2Y && ballY < player2Y + paddleHeight) {\n        ballSpeedX = -ballSpeedX;\n    }\n\n    // Reset ball if it goes out of bounds\n    if (ballX < 0 || ballX > canvas.width) {\n        ballX = canvas.width / 2;\n        ballY = canvas.height / 2;\n    }\n}\n\nfunction movePaddle(event) {\n    const key = event.key;\n    if (key === \'w\' && player1Y > 0) {\n        player1Y -= 20;\n    } else if (key === \'s\' && player1Y < canvas.height - paddleHeight) {\n        player1Y += 20;\n    }\n    if (key === \'ArrowUp\' && player2Y > 0) {\n        player2Y -= 20;\n    } else if (key === \'ArrowDown\' && player2Y < canvas.height - paddleHeight) {\n        player2Y += 20;\n    }\n}\n\ndocument.addEventListener(\'keydown\', movePaddle);\n\nfunction gameLoop() {\n    draw();\n    update();\n    requestAnimationFrame(gameLoop);\n}\n\ngameLoop();\n              } catch (err) {\n                console.error(err);\n              }\n            });\n          </script>\n        </body>\n      </html>\n    ', 'example@gmail.com', '2024-12-16 10:32:02', '2024-12-16 10:32:02', 0, 'public'),
