(1, '    In ra màn hình dòng chữ <b>\"Hello world\"</b>', 'Hello world', '//write here', '//write here\r console.log(\"Hello world\")'),
(2, '    Viết một hàm <b>findGCD</b> nhận vào hai tham số là hai số nguyên dương a và b, và trả về Ước chung lớn nhất (UCLN) của chúng. Nếu một trong các đầu vào không phải là số nguyên dương thì hàm trả về <b>\"Invalid input. Please provide two positive integers.\".</b>', '12 3 20 1', '/**\n * Finds the Greatest Common Divisor (GCD) of two numbers using Euclid\'s algorithm.\n * @param {number} a - First positive integer.\n * @param {number} b - Second positive integer.\n * @returns {number} The GCD of a and b.\n */\n\n\n// Sample usage\nconsole.log(findGCD(60, 48)); // 12\nconsole.log(findGCD(12, 15)); // 3\nconsole.log(findGCD(100, 80)); // 20\nconsole.log(findGCD(7, 13));   // 1', '\n/**\n * Finds the Greatest Common Divisor (GCD) of two numbers using Euclid\'s algorithm.\n * @param {number} a - First positive integer.\n * @param {number} b - Second positive integer.\n * @returns {number} The GCD of a and b.\n */\n\nfunction findGCD(a, b) {\n    if (b > a) {\n        let temp = a;\n        a = b;\n        b = temp;\n    }\n    while (b != 0) {\n        let temp = b;\n        b = a % b;\n        a = temp;\n    }\n    return a;\n}\n// Sample usage\nconsole.log(findGCD(60, 48)); // 12\nconsole.log(findGCD(12, 15)); // 3\nconsole.log(findGCD(100, 80)); // 20\nconsole.log(findGCD(7, 13));   // 1'),
(3, '    Viết hàm <b>calculateDiscount</b> nhận vào tổng số tiền mua hàng. Nếu số tiền trên 1000, giảm 15%; từ 500 đến 1000, giảm 10%; dưới 500, không giảm giá.', '1020 450', '/**\n * Calculates discount based on total amount.\n */\n\n\n// Sample usage\nconsole.log(calculateDiscount(1200)); // 1020\nconsole.log(calculateDiscount(450));  // 450', '/**\n * Calculates discount based on total amount.\n */\nfunction calculateDiscount(total) {\n    if (total > 1000) return total * 0.85;\n    if (total >= 500) return total * 0.90;\n    return total;\n}\n// Sample usage\nconsole.log(calculateDiscount(1200)); // 1020\nconsole.log(calculateDiscount(450));  // 450'),
(4, '    Viết hàm <b>reverseString</b> nhận vào một tham số str và trả về chuỗi đảo ngược của str.', 'olleh dlrow tpircSavaJ', '/**\n * Reverses a string.\n *\n * @param {string} str - The string to be reversed\n * @returns {string} The reversed string\n */\n\n\n// Sample usage\nconsole.log(reverseString(\"hello\")); // olleh\nconsole.log(reverseString(\"world\")); // dlrow\nconsole.log(reverseString(\"JavaScript\")); // tpircSavaJ', '/**\n * Reverses a string.\n *\n * @param {string} str - The string to be reversed\n * @returns {string} The reversed string\n */\n\nfunction reverseString(str) {\n    let reversed = \'\';\n    for (let i = str.length - 1; i >= 0; i--) {\n        reversed += str[i];\n    }\n    return reversed;\n}\n// Sample usage\nconsole.log(reverseString(\"hello\")); // olleh\nconsole.log(reverseString(\"world\")); // dlrow\nconsole.log(reverseString(\"JavaScript\")); // tpircSavaJ\n'),
(5, '    Viết hàm<b> convertNumberToMonth</b> nhận vào một số nguyên từ <b>1</b> đến <b>12</b> và trả về tên của tháng tương ứng bằng tiếng Việt. Ví dụ, nếu nhận vào số 1, hàm sẽ trả về <b>\"Tháng một\"</b>. Trường hợp khác, trả về <b>\"Tháng không hợp lệ\"</b>.\r \r Lưu ý: Đây là bài tập “luyện cơ tay”, giúp thành thạo cú pháp switch...case. Vì vậy, hãy tự tay gõ code để vượt qua bài tập này nhé!', 'Tháng một Tháng năm', '/**\n * Converts a number (1-12) to its corresponding Vietnamese month name.\n */\n\n\n// Sample usage\nconsole.log(convertNumberToMonth(1)); // Tháng một\nconsole.log(convertNumberToMonth(5)); // Tháng năm', '\n/**\n * Converts a number (1-12) to its corresponding Vietnamese month name.\n */\n\nfunction convertNumberToMonth(month) {\n    let result;\n\n    switch (month) {\n        case 1:\n            result = \"Tháng một\";\n            break;\n        case 2:\n            result = \"Tháng hai\";\n            break;\n        case 3:\n            result = \"Tháng ba\";\n            break;\n        case 4:\n            result = \"Tháng tư\";\n            break;\n        case 5:\n            result = \"Tháng năm\";\n            break;\n        case 6:\n            result = \"Tháng sáu\";\n            break;\n        case 7:\n            result = \"Tháng bảy\";\n            break;\n        case 8:\n            result = \"Tháng tám\";\n            break;\n        case 9:\n            result = \"Tháng chín\";\n            break;\n        case 10:\n            result = \"Tháng mười\";\n            break;\n        case 11:\n            result = \"Tháng mười một\";\n            break;\n        case 12:\n            result = \"Tháng mười hai\";\n            break;\n        default:\n            result = \"Tháng không hợp lệ\";\n    }\n    \n    return result;\n}\n// Sample usage\nconsole.log(convertNumberToMonth(1)); // Tháng một\nconsole.log(convertNumberToMonth(5)); // Tháng năm');
